      <img src="../../han.jpeg" alt="Your Name" style={{ maxWidth: '100px' }} />
      <p>Your Address</p>
    </div>
    <div style={{ flex: '2' }}>
      <h1>Publications</h1>
      <ul>
        <li>Publication 1</li>
        <li>Publication 2</li>
        <li>Publication 3</li>
      </ul>
    </div>
  </div>
  );
}

export default Publications;
